const dontHitATree = (path) => {
    let counter = 0
    let i = 0
    let j = 0
    let run = path[i]
    while (run && run[j]) {
        j++
        if (j % 3 === 0) {
            i++
            run = path[i]
            if (run && run[j] === "#") {
                counter++
            }
        }
    }
    return counter
}

const dontHitAnotherTree = (path, slopes) => {
    // slopes.forEach(slope => {
    //     console.log(Object.keys(slope))
    //     console.log(Object.values(slope))
    // })
    let accumulator = 1
    for (let k = 0; k < slopes.length; k++) {
        let across = Object.keys(slopes[k])[0]
        let down = Object.values(slopes[k])[0]

        let counter = 0
        let i = 0
        let j = 0
        let run = path[i]
        while (run && run[j]) {
            j++
            if (j % across === 0) {
                i += down
                run = path[i]
                if (run && run[j] === "#") {
                    counter++
                }
            }
        }
        accumulator *= counter
    }
    return accumulator
}

